          const tooltip = $("<div class='copyright-tooltip'>&copy; " + name + "</div>")
            .appendTo("body").css({

          const tooltipWidth = tooltip[0].getBoundingClientRect().width;

            })
          } else {
            tooltip.css({

            })
          }
